import Logo from "../../src/ecdis.jpg";

export default function Map() {
  const [open, setOpen] = useState(true);

  return (
    <div>
      <section class="w-full h-screen">
        <img
          src={Logo}
          class="object-cover w-full h-full"
          alt="Image alt text"
        />
      </section>
    </div>
  );
}
